  false,\n\t\"url\": null,\n\t\"notes\": \"The Sunk Lake Natural Area Management Plan
  guides the long-range development of the Natural Area by identifying and integrating
  appropriate habitats, management strategies, program elements, and facilities which
  support the goals and objectives for which the Natural Area was established.  The
  managment plan is divided into the following chapters: Legal Mandate and Assessment,
  Issue Assessment, Management Recommendations, Work Plan, and Monitoring. This plan
  constitutes a consensus between personnel from Hatchie National Wildlife Refuge
  and the Division of Ecological Services of the Tennessee Department of Conservation.
  This plan is a mandatory facet of a 10-year lease between the Tennessee Department
  of Conservation and the U.S. Fish and Wildlife Service to provide management and
  protection of Sunk Lake Natural Area.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
